import React, {Component} from 'react'
import Updates from '../../asserts/js/updates'

export class UpdatePost extends Component {
    constructor(props) {
        super(props)
    }

    render() {
        return (
            <div className="col-lg mt-4">
                <div className="row" >
                    <div className="col-6" style={{padding: '0px'}}>
                        <img src={Updates[0]} style={{width: '100%'}}/>
                    </div>
                    <div className="col-6" style={{margin: 'auto 0px'}}>
                        <label className="text-left">Coronavirus (COVID-19) Infomation</label>
                        <p className="text-justify">Find out what you should do during quarantine and our temporary closure</p>
                    </div>
                </div>
            </div>

        )
    }
}
